import "./App.css";

import React, { useEffect, useRef } from 'react';
const { tableau } = window;

export const TableauChart = () => {
  const ref = useRef(null);
  const url = "https://public.tableau.com/views/FavoritePerson/Sheet1?:language=en-US&publish=yes&:display_count=n&:origin=viz_share_link";

  useEffect(() => {
    const initViz = () => {
      new tableau.Viz(ref.current, url);
    };

    initViz();
  }, [url]);

  return (
    <div ref={ref} style={{ width: '70%', margin: 'auto' }}></div>
  );
};
